function Layout() {
    return( <div className="layout">
      <CustomHead/>
  </div>)
}

//Setting page head
function CustomHead() {
  return(
  <Head>
    <title>Covid Anchor</title>
    <link rel="stylesheet" href="/css/global.css" />
      </Head>
  )
}
